import * as common from './common';
export { common };
export interface PerformanceSend {
    /** performance */
    ev_type: string;
    payload: PerformancePayload;
    common: common.Common;
}
export interface PerformancePayload {
    /** 指标名称 */
    name: string;
    /** 当前值 */
    value: number;
    /** 性能指标类型， perf => 传统性能, spa => SPA 性能, mf => 微前端性能 */
    type: string;
    /** 是否支持 */
    isSupport?: boolean;
    /** 是否是Polyfill */
    isPolyfill?: boolean;
    /** 是否跳出 */
    isBounced?: boolean;
    /** 是否自定义 */
    isCustom?: boolean;
    /** 指标的相关信息 */
    extra?: {
        [key: string]: string;
    };
}
